package main

import (
    "fmt"
    "strings"
)

func canChange2(start string, target string) bool {
    // 还是双指针吧，先移动 target，再去找 start
    var startIndex, targetIndex int
    var position int // 1=left, 2=right
    if len(target) != len(target) {
        return false
    }

    for {
        for targetIndex < len(target) {
            if target[targetIndex] == '_' {
                targetIndex++
            } else if target[targetIndex] == 'L' {
                position = 1
                break
            } else {
                position = 2
                break
            }
        }
        // target 已找好,匹配 start
        for startIndex < len(start) {
            if start[startIndex] == '_' {
                startIndex++
            } else if start[startIndex] == 'L' {
                // 左移
                if position == 0 {
                    // 完全匹配不上
                    return false
                } else if position == 2 {
                    // 完全匹配不上
                    return false
                } else {
                    if startIndex >= targetIndex {
                        // 成功匹配
                        startIndex++
                        targetIndex++
                        position = 0
                        break
                    } else {
                        // 完了，没到
                        return false
                    }
                }
            } else {
                // 右移
                if position == 0 {
                    return false
                } else if position == 1 {
                    // 完全匹配不上
                    return false
                } else {
                    if startIndex <= targetIndex {
                        // 成功匹配
                        startIndex++
                        targetIndex++
                        position = 0
                        break
                    } else {
                        startIndex++
                        // 完了，过了
                        return false
                    }
                }
            }

        }

        if startIndex == len(start) {
            for targetIndex < len(target) {
                if target[targetIndex] == '_' {
                    targetIndex++
                } else {
                    return false
                }
            }
            if position == 0 {
                return true
            } else {
                return false
            }
        }
    }
}

func canChange4(start string, target string) bool {
    // 没那么简单，我说吧，要真的这么简单就完了
    // 还是要看下顺序的
    return strings.ReplaceAll(start, "_", "") == strings.ReplaceAll(target, "_", "")
}
func canChange3(start string, target string) bool {
    // 我哭了，我真的
    // 去掉 _ 之后应该是一样的即可
    var cleanStart, cleanTarget []byte
    for _, char := range start {
        if char != '_' {
            cleanStart = append(cleanStart, byte(char))
        }
    }
    for _, char := range target {
        if char != '_' {
            cleanTarget = append(cleanTarget, byte(char))
        }
    }

    return string(cleanStart) == string(cleanTarget)
}

func canChange(start string, target string) bool {
    var startIndex, targetIndex int
    var position int // 1=left, 2=right
    if len(target) != len(target) {
        return false
    }
    for targetIndex = 0; targetIndex < len(target); targetIndex++ {
        if target[targetIndex] == '_' {
            continue
        } else if target[targetIndex] == 'L' {
            position = 1
        } else {
            position = 2
        }

        // target 已找好,匹配 start
        for startIndex < len(start) {
            if start[startIndex] == '_' {
                startIndex++
            } else if start[startIndex] == 'L' {
                // 左移
                if position == 0 {
                    // 完全匹配不上
                    return false
                } else if position == 2 {
                    // 完全匹配不上
                    return false
                } else {
                    if startIndex >= targetIndex {
                        // 成功匹配
                        startIndex++
                        position = 0
                        break
                    } else {
                        // 完了，没到
                        return false
                    }
                }
            } else {
                // 右移
                if position == 0 {
                    return false
                } else if position == 1 {
                    // 完全匹配不上
                    return false
                } else {
                    if startIndex <= targetIndex {
                        // 成功匹配
                        startIndex++
                        position = 0
                        break
                    } else {
                        startIndex++
                        // 完了，过了
                        return false
                    }
                }
            }

        }

        if position != 0 {
            return false
        }
    }
    for startIndex < len(start) {
        if start[startIndex] == '_' {
            startIndex++
        } else if start[startIndex] == 'L' {
            // 左移
            if position == 0 {
                // 完全匹配不上
                return false
            } else if position == 2 {
                // 完全匹配不上
                return false
            } else {
                if startIndex >= targetIndex {
                    // 成功匹配
                    startIndex++
                    position = 0
                } else {
                    // 完了，没到
                    return false
                }
            }
        } else {
            // 右移
            if position == 0 {
                return false
            } else if position == 1 {
                // 完全匹配不上
                return false
            } else {
                if startIndex <= targetIndex {
                    // 成功匹配
                    startIndex++
                    targetIndex++
                } else {
                    startIndex++
                    // 完了，过了
                    return false
                }
            }
        }

    }

    if position == 0 {
        return true
    } else {
        return false
    }
}

